import Steak from "../../img/img_gallery/steak.jpg";
import Wine from "../../img/img_gallery/wine.jpg";

const Gallery = () => {
  const images = [Gift, Inside, Inside2, Mojito, Steak, Wine];
  return (
    <div>
      <img src={Gift} alt="" srcset="" />
    </div>
  );
};

export default Gallery;
